import React from "react";
import style from "./keyboard.module.css";
import Display from "../display/display";
let valor = "";
const handleClick = (e) => {
	valor = e.target.value
}
const KeyBoard = function (handleClick,valor) {
    return (
        <div>
				<Display value={valor}/>
            <table >
				<tbody className={style.tdLine}>
			
					<tr className={style.tdLine}></tr><tr className={style.tdLine}></tr><tr className={style.tdLine}></tr>
				
					<tr className={style.tdLine}>
						<td className={style.tdLine}>  <button className={style.botonesStyle} onClick= {value='1'}>1</button></td>
						<td className={style.tdLine}>  <button className={style.botonesStyle} onClick= {value='2'}>2</button></td>
						<td className={style.tdLine}>  <button className={style.botonesStyle} onClick= {value='3'}>3</button></td>
					</tr>
					<tr className={style.tdLine}>
						<td className={style.tdLine}>  <button className={style.botonesStyle} onClick= {value='4'}>4</button></td>
						<td className={style.tdLine}>  <button className={style.botonesStyle} onClick= {value='5'}>5</button></td>
						<td className={style.tdLine}>  <button className={style.botonesStyle} onClick= {value='6'}>6</button></td>
					</tr>
					<tr className={style.tdLine}>
						<td className={style.tdLine}>  <button className={style.botonesStyle} onClick= {value='7'}>7</button></td>
						<td className={style.tdLine}>  <button className={style.botonesStyle} onClick= {value='8'}>8</button></td>
						<td className={style.tdLine}>  <button className={style.botonesStyle} onClick= {value='9'}>9</button></td>
					</tr>
					<tr className={style.tdLine}>
						<td className={style.tdLine}><button className={style.botonesStyle} onClick= {value='delete'}>←</button></td>
						<td className={style.tdLine}><button className={style.botonesStyle} onClick= {value='0'}>0</button></td>
						<td className={style.tdLine}><button className={style.botonesStyle} onClick= {value='ok'}>√</button></td>
						<td></td>
					</tr>
				</tbody>
			</table>
        </div>
    );
};

export default KeyBoard;
